import React from 'react'

const UsernameInput = () => {
    const {username,setUsername}=this.props;
    return (
        <div className='login-page_input_container'>
            <input placeholder='Enter your name' type='text' value={username} onChange={(event) => { setUsername(event.target.value) }} className='login-page_input background_main_color text'>
            </input>
        </div>
    );
};
export default UsernameInput;
